En "Otras deudas" el declarante incluye tres préstamos hipotecarios que debe su sociedad patrimonial y que suman más de 600.000 Euros, de los cuales hay pendientes a 31/12/2010 algo menos de la mitad.
@dcabo: Parece haberse hecho a su sociedad un préstamo. Sumando los personales y los de su sociedad, hay un millón de euros de hipotecas con Novacaixagalicia.
Un Jaguar, un barco...

Sorprende que teniendo un montante neto al año de 16.643 euros, le hayan concedido creditos por el valor de 341000 euros
@dcabo: Más el sueldo de senador, no incluido.
Pepe: Cobra tres sueldos públicos: Junta de Andalucía, Parlamento de Andalucía y Senado. Y no es ilegal hacerlo.
